import React, { Component } from 'react';

import './home.css';
import Photoplay from './photoplay';

class Home extends Component {

    render() {
        return (
            <div>
                <Photoplay />
                <section className="test">
                    <p>这是标题</p>
                    <h1>hxxsa</h1>
                    <span>sdwew</span>
                </section>
                <section className="test">
                    <h1>hxxsa</h1>
                    <p>sdwew</p>
                    <div>sqwsq</div>
                </section>
            </div>
        );
    }
}

export default Home;
